class Solution:
    # 错误的贪心思维：构成子序列的停止条件是，当前元素出现的次数 大于等于下一个元素出现的次数
    # 堆来解决
    def isPossible(self, nums) -> bool:
        from collections import Counter
        from queue import PriorityQueue
        record = Counter(nums)
        q = PriorityQueue()
        for i in record.items():
            q.put(i)
        
        left = None
        prev_count = float('-inf')
        length = 0
        res = []
        while  res or not q.empty():
            if  q.empty(): # 如果队列为空，需要将上一轮储存的多余元素res元素重新插入优先队列中
                for _ in range(len(res)):
                    q.put(res.pop())

            cur, cur_count = q.get()
            if  left is None: 
                left, dup = cur, cur_count
                length = 1 # 当前子串长度 
            elif cur == prev + 1 and cur_count - dup >= prev_count:
                if cur_count - dup > 0: # 有剩余元素时
                    res.append((cur, cur_count - dup))
                length += 1 # 长度 + 1
            else:
                if length < 3: 
                    print(length, res, left, cur, dup, cur_count)
                    return False # 如果凑不齐3个元素
                length, left = 0,  None
                res.append((cur, cur_count)) # 将分割点也放回优先队列中
                for _ in range(len(res)):
                    q.put(res.pop())

            prev, prev_count = cur,  cur_count

        print(res, left, cur, dup, cur_count)
        return length >= 3

    # 思路1： 字典(子序列的结尾元素x为建) + 最小堆(value)
    # 思考方式是：当前元素 x 如果和 x - 1 购成子序列，则采取和以 x-1 为结尾的最短子序列进行构建
    # 如果不存在 以 x - 1 为结尾的子序列，则新开辟一个以 x 为结尾的子序列 长度为  1
    # O(nlogn)
    def isPossible(self, nums) -> bool:
        from collections import defaultdict
        record = defaultdict(list)
        import heapq

        for x in nums:
            if not record[x-1]:
                record[x].append(1)
            else:
                length = heapq.heappop(record[x-1])
                heapq.heappush(record[x], length+1)
        
        return all(heapq.heappop(v) >= 3 for v in record.values() if v)

    # 思路2: 贪心 （两个字典）
    # O(n) 的时间复杂度
    def isPossible(self, nums) -> bool:
        from collections import Counter, defaultdict
        res_count = Counter(nums)
        seq_num_by_num =  defaultdict(int)

        for i in nums:
            if res_count[i] > 0:
                if seq_num_by_num[i-1] > 0:
                    seq_num_by_num[i] += 1
                    seq_num_by_num[i-1] -= 1
                elif res_count[i+1] > 0 and res_count[i+2] > 0:
                    res_count[i+1] -= 1
                    res_count[i+2] -= 1
                    seq_num_by_num[i+2] += 1
                else: return False

                res_count[i] -= 1
    
        return True


